import './App.css';

export default function App() {
  const todos=[
    {id:1, text:"laundry", done:false},
    {id:2, text:"Fruits", done:false},
    {id:3, text:"Exam paper", done:false}
  ]

  return (
    <div className="App">
     <h1>Todo List</h1>
     <TodoList todos={todos} />
    </div>
  );
}

function TodoList(props){

  return(
    <ul>
      {props.todos.map(todo=>
       <li key_>{todo.text}</li>       
        )}
    </ul>
  )
}
